            {
                booksData.map((book, index)=>(
                    <tr key={index}>
                    <th scope="row">{book.id}</th>
                    <td >{book.title}</td>
                    <td>{book.description}</td>
                    <td >{book.publication_date}</td>
                    <td>{book.publisher}</td>
                    <td >{book.ISBN}</td>
                    <td>{book.pages}</td>
                    <td >{book.genre}</td>
                    <td>{book.date_added}</td>
                    {isLoggedIn ? (
                        <td><Button variant="outline-primary"as={Link} to="/editBook">Edit</Button></td>
                    ):(
                        <td><Button variant="outline-primary"as={Link} to="/signin">Edit</Button></td>
                    )
                    }
                    <td><Button onClick={() => handleDelete(book.id)} variant="outline-danger">Delete</Button></td>
                    </tr>        

